import React from "react";
import { Dimmer, Loader, Segment } from "semantic-ui-react";

const LoadingSpinner = () => (
  <Segment>
    <Dimmer active>
      <Loader size="massive">Loading</Loader>
    </Dimmer>
  </Segment>
);

export default LoadingSpinner;
